  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on North Dakota Limited-interest NWRs for the next
  15 years. This plan outlines the refuges' vision and purpose and describes how North
  Dakota Limited-interest NWRs will contribute to the overall mission of the Refuge
  System. The plan provides an introduction to the refuges, an overview of the CCP
  process, alternatives, information about the management direction, a description
  of the affected environment, and environmental consequences. Key planning issues
  include: wetland management, upland management, partnerships, and visitor services.\",\n\t\"owner_org\":
